import React from "react";
import { FirstName, LastName } from "./App";

const CompC = () => {
  return (
    <>
      <FirstName.Consumer>
        <LastName.Consumer>
          {(fname, lname) => {
            return (
              <h1>
                My name is {fname} {lname}
              </h1>
            );
          }}
        </LastName.Consumer>
      </FirstName.Consumer>
    </>
  );
};

export default CompC;
